import React from 'react';
import {connect} from 'react-redux';
import {fetchPosts} from '../actions';

class PostList extends React.Component {
	state = {
		visible: [],
		counter: 0
	}

	componentDidMount() {
		this.props.fetchPosts(this.props.id);
	}

	renderList() {
		return this.props.posts.map(post => {
			return (
				<div className="item" key={post.id}>
					<div className="comment">
						<div className="avatar"><img src="data:image/jpeg;base64," /></div>
						<div className="content">
							<a className="author">{post.name}</a>
							<div className="metadata"><div>Yesterday at 12:30AM</div></div>
							<div className="text"><p>{post.body}</p></div>
							<Link to="/lol" className="ui button primary inverted">
								Reply
							</Link>

						</div>
					</div>
				</div>
			);
		});
	}

	render() {
		return (
			<div>
				<div className="ui relaxed divided list">{this.renderList()}</div>
			</div>
		);
	}
}

const mapStateToProps = (state) => {
	return {
		posts: Object.values(state.posts2)
	};
}

export default connect(mapStateToProps, {fetchPosts}) (PostList);
